tables.table_schema:
CREATE TABLE pro_shop_sales (
    sale_id INT PRIMARY KEY,
    product_id INT,
    quantity INT,
    sale_date DATE
);

CREATE TABLE pro_shop_inventory (
    product_id INT PRIMARY KEY,
    product_name VARCHAR(255),
    quantity_in_stock INT,
    restock_level INT
);

CREATE TABLE pro_shop_inventory (
    product_id SERIAL PRIMARY KEY,
    product_name VARCHAR(255) NOT NULL,
    price DECIMAL NOT NULL,
    quantity INT NOT NULL
);

CREATE TABLE restocking (
    restock_id SERIAL PRIMARY KEY,
    product_id INT REFERENCES pro_shop_inventory(product_id),
    restock_date DATE NOT NULL,
    quantity_restocked INT NOT NULL
);

CREATE TABLE PopularProducts (
    id SERIAL PRIMARY KEY,
    product_name VARCHAR(255) NOT NULL,
    sold_quantity INTEGER NOT NULL
);

CREATE TABLE GolfCourses (
    id SERIAL PRIMARY KEY,
    course_name VARCHAR(255) NOT NULL,
    location VARCHAR(255) NOT NULL
);
